SELECT id, band_width, cpu, date_registered, disk, id_instance, ram
  FROM kp.metric
  LIMIT 500;

SELECT id, email, isactivated, name, password, role
  FROM kp.user
  LIMIT 500;

SELECT id, date_finished, id_created, id_rsc, id_user, id_vm, is_finish, is_stop
  FROM kp.instance
